from PIL import Image
import pyperclip

im = Image.open('math.png') # Can be many different formats.
pix = im.load()
w, h = im.size
# print(w,h)
ans = ""
black = "(0, 0, 0)"
white = "(255, 255, 255)"
# print(pix[105][17])
for x in range(w):
    for y in range(h-1,-1,-1):
        if (str(pix[x,y]) == white):
            ans += "0"
        else:
            ans += "1"
            
pyperclip.copy(ans)
# print(ans, len(ans))
base10 = int(ans,2)
print(base10) 

